Create a simple Node.js application that serves a JSON response: app.js const http = require('http'); const hostname = '0.0.0.0';
const port = 4000; const server = http.createServer((req, res) => { res.writeHead(200, { 'Content-Type': 'application/json' }); res.end(JSON.stringify({ message: 'Hello from Docker!' }));
}); server.listen(port, hostname, () => { console.log(`Server running at http://${hostname}:${port}/`);
});
